export const BlogCard = ({title, image_url}) => { 
    return (
        <Col sm = {6} md = {4}> 
        <div className ="blog-card">
            <img src = {image_url} /> 
            <div className ="proj-txt">
                <h4>{title}</h4>
            </div>
        </div>
        </Col>
    )
}
